import React from "react";
// import { PromiseProvider } from "mongoose";
// import "./style.css";
import Jumbotron from "../"

export const GetInspiredCard = ({ children }) => {
    return <div>
    <div className="card">
    <div className="card-header">
    <Jumbotron>
        <h1>Get Inspired!</h1>
    </Jumbotron>
    </div>
    <div className="card-body">
        {children}
    </div>
    </div>
</div>
}
